.title{
    display: flex;
    justify-content: space-between;
    margin-bottom: 20px;
    .wenzi{
        width: 18%;
        padding: 20px 10px;
        background: #ebf3fe;
        border: 1px solid #a9c4df;
        .diyih{
          display: flex;
          justify-content: space-between;
          align-items: center;
          .zongshu{
              padding: 10px 20px;
              font-size: 30px;
              font-weight: 1000;
          }
          .zengzhang{
              padding: 10px 20px;
              span:nth-child(2){
                font-size: 22px;
                color: red;
              }
          }
        }
        .count-item{
            padding: 0 20px;
        }
    }
}
input{
    outline: none;
    border: none;
}
.one{
    display: flex;
    align-items: center;
    margin: 10px 0;
    span{
        padding-left: 6px;
        font-weight: 1000;
        font-size: 20px;
    }
}
.two{
    width: 100%;
    display: flex;
    margin: 20px 0;
    .left{
        width: 50%;
        box-sizing: border-box;
        height: 400px;
        border-bottom: 1px solid #e1e7ef;
        border-top: 1px solid #e1e7ef;
        border-left: 1px solid #e1e7ef;
        padding-top: 16px;
    }
    .midd{
        width: 25%;
        box-sizing: border-box;
        height: 400px;
        border-bottom: 1px solid #e1e7ef;
        border-top: 1px solid #e1e7ef;
        border-left: 1px dashed #e1e7ef;
        padding-top: 16px;
    }
    .right{
        width: 25%;
        box-sizing: border-box;
        height: 400px;
        border-bottom: 1px solid #e1e7ef;
        border-top: 1px solid #e1e7ef;
        border-left: 1px dashed #e1e7ef;
        border-right: 1px dashed #e1e7ef;
        padding-top: 16px;
    }
}
